INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (101, 0, 1.5, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 160, 0, 122601, 1, 1, 1, 105, 1, 0.029, 110);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (102, 1, 2.5, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 120, 0, 122401, 2, 2, 0, 111, 3, 0.014, 105);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (103, 0, 2.5, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 350, 1, 122501, 3, 3, 0, 105, 2, 0.017, 110);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (104, 1, 1.5, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 130, 0, 107501, 4, 4, 0, 105, 3, 0.016, 110);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 0, 2.5, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 160, 0, 107601, 5, 5, 1, 105, 1, 0.014, 110);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (106, 0, 3.5, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 255, 1, 107801, 6, 6, 0, 103, 2, 0.029, 120);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (107, 0, 3.5, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 160, 0, 110601, 7, 7, 1, 103, 1, 0.013, 120);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (108, 0, 2.5, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 350, 1, 110401, 8, 8, 0, 103, 2, 0.014, 110);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (109, 1, 1.5, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 130, 0, 110501, 9, 9, 0, 100, 3, 0.012, 105);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, 0, 2.5, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 200, 0, 115701, 10, 10, 1, 103, 1, 0.014, 105);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (111, 0, 2.5, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 350, 1, 113601, 11, 11, 0, 103, 2, 0.071, 105);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (112, 1, 1.5, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 130, 0, 107901, 12, 12, 0, 103, 3, 0.014, 120);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (113, 0, 1.5, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 200, 0, 108001, 13, 13, 1, 105, 2, 0.022, 110);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (114, 0, 2.5, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 160, 0, 110301, 14, 14, 1, 108, 1, 0.031, 110);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (115, 1, 0.5, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 130, 0, 107701, 15, 15, 0, 105, 1, 0.036, 110);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (116, 0, 3.5, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 350, 1, 113101, 16, 16, 0, 95, 2, 0.048, 110);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (117, 1, 1.5, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 130, 0, 113301, 17, 17, 0, 105, 3, 0.043, 105);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (118, 1, 1.5, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 130, 0, 113201, 18, 18, 0, 95, 2, 0.018, 105);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (119, 0, 2.5, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 160, 0, 117001, 19, 19, 1, 108, 2, 0.021, 110);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (120, 0, 2.5, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 255, 1, 113501, 20, 20, 0, 105, 1, 0.036, 110);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (121, 0, 2.5, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 350, 1, 113401, 21, 21, 0, 105, 3, 0.02, 105);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (122, 1, 2.5, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 130, 0, 110101, 22, 22, 0, 105, 1, 0.018, 110);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (123, 0, 3.5, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 160, 0, 110001, 23, 23, 1, 111, 3, 0.03, 105);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (124, 1, 1.5, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 130, 0, 117201, 24, 24, 0, 103, 1, 0.027, 110);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (125, 0, 3.5, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 160, 0, 117301, 25, 25, 1, 108, 2, 0.02, 105);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (126, 0, 2.5, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 350, 1, 117401, 26, 26, 0, 105, 3, 0.04, 110);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (127, 0, 3.5, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 350, 1, 117101, 27, 27, 0, 105, 1, 0.009, 110);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (128, 0, 3.5, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 255, 1, 122901, 28, 28, 0, 105, 1, 0.022, 120);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (129, 1, 2.5, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 130, 0, 122801, 29, 29, 0, 105, 3, 0.028, 110);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (130, 0, 3.5, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 130, 0, 122701, 30, 30, 1, 108, 2, 0.023, 105);
